    "content":"<h2>Sejarah Berdirinya Salib Kasih</h2><p>Salib Kasih sendiri menjadi landmarknya kota Tarutung. Wisata rohani keren ini terdapat di Desa Situngkir, Simorangkir Julu, Kota Tarutung, Sumatera Utara, Indonesia. Salib Kasih sendiri merupakan sebuah monumen berupa salib dengan ukuran yang besar dan menjulang tinggi. Bentuknya juga seperti bentuk salib kebanyakan. Salib Kasih dibangun pada Oktober 1933 dan diperuntukkan untuk mengenang jasa dari misionaris Kristen asal Jerman yaitu Ingwer Ludwig Nommensen. Pada saat menyebarkan agama Kristen di Tapanuli , Nommensen berkali kali hendak dibunuh oleh masyarakat pribumi disana namun selalu gagal. Usaha Nommensen pun tak sia sia karena banyak masyarakat lokal akhirnya memeluk agama Kristen dan meninggalkan kepercayaan lama mereka yaitu animism.</p><p>Di lokasi Salib Kasih terdapat patung IL Nommensen berwarna putih. Disinilah pertama kali Nommensen berkhotbah dan dia menghadap ke arah Rura Silindung dibawah dia. Selain itu, di lokasi Salib Kasih terdapat banyak ruangan ruangan kecil khusus untuk berdoa umat Kristen. Di dalam ruangan doa tersebut terdapat gambar Yesus Kristus serta satu buah Alkitab. Di ruangan kita bisa berdoa sepuasnya dengan suasana yang damai. Di lokasi Salib Kasih terdapat tempat duduk dan pondok pondok yang terbuat dari keramik. Dari sinilah kita dapat puas melihat keindahan pemandangan Kota Tarutung dari ketinggian. Susana sekitaran Salib Kasih juga sejuk dan masih asri. Banyak pohon pinus yang mengelilingi lokasi Salib Kasih menjadikan udara di sekitarnya masih segar dan alami. Banyak juga terdapat patung patung khas Kristen dan nisan yang bisa dijadikan untuk spot berfoto ria.</p><p>Selain tempat berdoa dan wisata rohani, Salib Kasih juga diyakini sebagai tempat tinggal dari Sombaon. Sombaon sendiri dipercayai oleh masyarakat Batak sebagai roh alam dengan kedudukan tertinggi. Sombaon dipercaya yang memberikan nasib buruk dan nasib baik bagi masyarakat setempat. Oleh karena itu, Sombaon termasuk salah satu yang ditakuti. Tak perlu heran kalo Sombaon dipuja puja di tempat ini. Terkadang juga masyarakat memberikan sesajen untuk Sombaon agar memberikan keberuntungan bagi masyarakat disana.</p><p>Jika kalian mengunjungi Tarutung, sangatlah tidak puas bila tak mengunjungi Salib Kasih. Karena selain berwisata jasmani, di Salib Kasih kita juga dapat memperdalam iman kita. Di tempat setiap hari Minggunya diadakan ibadah. Tempat ini akan sangat ramai dikunjungin menjelang Natal dan Tahun Baru. Buat kalian yang ingin meninggalkan kenang kenangan di Salib Kasih, kalian dapat menulis nama kalian di nisan nisan yang ada di sini. Dari nisan nisan yang ada, membuktikan bahwa pengunjung di sini tak hanya orang Sumatera saja, ada juga orang dari luar Sumatera seperti Jawa dan Papua. Turis asing juga sering mengunjungi tempat ini untuk berdoa atau sekedar berfoto.</p><p>Sebelum menuju lokasi Salib Kasih yang berada diatas bukit, pengunjung dapat berburu dan berbelanja souvenir khas Salib Kasih yang berada di bawah yaitu di Pasar Wisata. Banyak souvenir dan cendramata yang dijual disini mulai dari jaket, kaos, gelang, kalung, syal dan lain sebagainya. Ciri khas nya setiap souvenir pasti terdapat tulisan Salib Kasih Tarutung.</p><p>Menuju lokasi Salib Kasih di puncak bukit, pengunjung akan menaikin ribuan anak tangga. Ada dua jalur yang disediakan yaitu jalur untuk orang tua dan jalur untuk orang muda. Selama perjalanan menuju lokasi, kalian akan melewati pohon pohon pinus yang rindang. Kalian akan melewati papan tulisan 10 Perintah Tuhan yang dipasang di pohon pohon pinus tersebut. Selain 10 Peintah Tuhan, banyak juga ayat ayat alkitab yang akan kalian lewati sebelum mencapai Salib Kasih. Jika kalian lelah, kalian juga dapat beristirahat sejenak di bangku bangku yang ada di perjalanan menuju puncak.</p>",
